import React from 'react'
import { storage, db } from '../firebase/config'

const ImageGrid = ({ url, error }) => {
    return (
        <div>
            <img src={url} style={{ width: "200px", height: "200px", marginTop: "50px", opacity: "0.7" }} alt="url.name" />
            <p>{error}</p>
        </div >
    )
}

export default ImageGrid
